case class Event (window: List[MarketData], variance: Double)

def windowVariance(data: Iterable[MarketData]) : Iterable[Event] = {
    var events = List[Event]()
    val sorted = data.toList.sortWith(_.date.getTime < _.date.getTime)
    val windows = sorted.sliding(10,1).toList

    for (w <- windows) {
        val closePrices = w.map(_.close)
        val mean = (closePrices.sum / closePrices.size)
        var tmp=0.0
        for (c <- closePrices) {
            tmp += Math.pow((c-mean),2)
        }
    var variance = tmp / closePrices.size
    events = events :+ Event(w, variance)
    }
    return events
}

print("%table symbol\tdate\tclose\tvariance\n")

for (e<-events.take(830)) { //.sortWith(_.variance > _.variance) ) {
    for (w<- e.window ) { //.sortWith(_.date.getTime > _.date.getTime) ) {
      println(w.product +"\t" + w.date + "\t" +w.close + "\t" + e.variance)
    }
}

def sentiment(s:String) : String = {
    val positive = Array("like", "liked", "love", "good", "great", "happy", "cool", "one")
    val negative = Array("hate", "bad", "stupid", "dislike", "poor")

    var st = 0;

    val words = s.split(" ")    
    positive.foreach(p =>
        words.foreach(w =>
            if(p==w) st = st+1
        )
    )

    negative.foreach(p=>
        words.foreach(w=>
            if(p==w) st = st-1
        )
    )
    if(st>0)
        "positive"
    else if(st<0)
        "negative"
    else
        "neutral"
}

sqlc.udf.register("sentiment", sentiment _)
